import React from 'react';
import axios from 'axios';

function App() {
  const [users, setUsers] = React.useState([]);

  React.useEffect(() => {
    axios.get('http://localhost:3000/users').then(res => setUsers(res.data));
  }, []);

  return (
    <div>
      <h1>Usuarios</h1>
      <ul>
        {users.map(users => (
          <li key={users.id}>{users.nombre}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
